class NumArray:    def __init__(self, nums):        """        :type nums: List[int]        """        n = len(nums)        self.sum1, temp = [0 for i in range(n)], 0        for i in range(n):            temp += nums[i]            self.sum1[i] = temp    def sumRange(self, i, j):        """        :type i: int        :type j: int        :rtype: int        """        if i - 1 >= 0:            return self.sum1[j] - self.sum1[i - 1]        return self.sum1[j]# Your NumArray object will be instantiated and called as such:# obj = NumArray(nums)# param_1 = obj.sumRange(i,j)